import { React, useContext} from 'react'
import ImageBlock from './ImageBlock'

const FooterSectionThree = () => {

  const background = useContext(ThemeContext)

  return (
    <div className={`pt-[180px] ${background ? `${background.darkBgColor}` : ``}`}>
      <ImageBlock
      blockStyles='bg-gradient-to-l from-red-500 to bg-purple-600 rounded-lg shadow-2xl h-[450px]'
      />
    </div>
  )
}

export default FooterSectionThree
